DEMOS: SEND US A PVT MESSAGE HERE PLEASE (no external link to download es.wetransfer, etc )
Aenaria Recordings, introduced in 2006, is the company of Italian dj/producer Luca Ricci&#13;
The efforts of Aenaria Recordings will be directed towards helping passionate artists on their quest to get their work heard by anyone who loves the art of music. Aenaria Recordings will be a stepping stone for young talent and a positive outlet for people that share the same passion: music!&#13;
Aenaria Recordings is divided into 4 different labels each with their own style:&#13;
Aenaria Music&#13;
A variety of productions from warm Melodic, Deep House to Uplifting, Vocal Funky House to Big Room House productions. This label is inspired by the early days in House Music and will contribute to keep House Music alive.&#13;
Aenaria Tribal&#13;
As the name suspects, this is about Tribal House. However not just the big room peak hour bombs, also the ethnic deep & dark tribal productions. All in all this label will be providing a wide range of styles in the tribal genre that will appeal to many.&#13;
Aenaria Tech&#13;
This label might become the most experimental of all four labels.Fresh experimental productions varying from minimal techno to progressive styles with electro influences.&#13;
Aenaria Chill&#13;
Will release a cd compilation series of Chill-Out Music.Various productions of Breaks, Atmospheric, Dreamy and Lush sounding Progressive with pulsating house beats will be available on vinyl and digital downloads as well&#13;
http://www.facebook.com/aenariarecordings&#13;

