TVset under repair (Телевизор на ремонте) is a electronic project in the vast fields of  electronica, ambient, downtempo and easy-listening with a strong touch of "chiptune". Project consists of three human beings: Dmitri Kosischev, Taras Melnichuk and Oleg Bogatko.
Starting 2003 the combo has produced next albums:
- Concretica - {year: 2003}
- Negamegapolisa - {year: 2004}
- Smena 8M - {year: 2004}
- Cosmoportable - {year:2005 | best-of compilation}
- Fingering. Handjob. Mixing - {year: 2009 }.

Follow our Side Projects

